import { Container, Navbar,Table,Button } from "react-bootstrap";
import CategoryService from "../../Services/Category/index";

import "./style.css";

export default function Cesta() {

    const [compra, setCompra] = useState([]);

    useEffect(() => {
        getCompra();
    }, []);


    const getCompra = () => {
        CategoryService.getAll()
        .then(response => {
            setCompra(response.data);
            console.log(response.data);
        })
        .catch(e => {
            console.log(e);
        });
    };

    return (

        <Container fluid="sm" className="Main">

            <Navbar className="Navigation">
                <Navbar.Brand > <h4> Livros disponiveis </h4></Navbar.Brand>
                <Navbar.Toggle />
            </Navbar>

            <Table striped hover >
            {compra &&  compra.map((category, index) => (
             <div key={index}>
                <thead>
                    <tr className="text-center">
                        <th>#</th>
                        <th>Pedido</th>
                        <th>Pre√ßo</th>
                        <th></th>
                    </tr>
                </thead>
                <tbody>
                    <tr className="text-center">
                        <td>1</td>
                        <td>Mark</td>
                        <td>R$ 200</td>
                        <td><Button variant="danger">Excluir</Button></td>
                    </tr>
                </tbody>

                </div>
            ))}
            </Table>

            <Navbar className="justify-content-between" >
            <Navbar.Brand > Valor Total: 1000 </Navbar.Brand>
                <Button variant="primary">Finalizar Compra</Button>
                <Navbar.Toggle />
            </Navbar>

        </Container >
    )
}
